// Populate Movies
function populateMovies() {
  const movieGrid = document.getElementById("movie-grid");
  movieGrid.innerHTML = ""; // Clear grid before appending movies

  movies.forEach(movie => {
    const movieItem = document.createElement("div");
    movieItem.classList.add("movie-item");

    const movieImage = document.createElement("img");
    movieImage.src = movie.image;
    movieItem.appendChild(movieImage);

    const overlay = document.createElement("div");
    overlay.classList.add("movie-overlay");
    overlay.textContent = `${movie.price}`;
    movieItem.appendChild(overlay);

    movieItem.addEventListener('click', () => showMovieDetails(movie));

    movieGrid.appendChild(movieItem);
  });
}

// Show Movie Details
function showMovieDetails(movie) {
  const popup = document.getElementById("movie-popup");
  const movieTitle = document.getElementById("movie-title");
  const moviePrice = document.getElementById("movie-price");

  movieTitle.textContent = movie.title;
  moviePrice.textContent = `Price per Ticket: ${movie.price}`;

  popup.style.display = "flex";
  document.getElementById("ticket-count").value = 1;
  document.getElementById("total-price").style.display = "none";
  document.getElementById("book-ticket-btn").style.display = "none";
}

// Calculate Total Price
function calculatePrice() {
  const ticketCount = document.getElementById("ticket-count").value;
  const movieTitle = document.getElementById("movie-title").textContent;
  const movie = movies.find(m => m.title === movieTitle);
  const totalPrice = movie.price * ticketCount;

  document.getElementById("total-price").textContent = `Total Price: ${totalPrice}`;
  document.getElementById("total-price").style.display = "block";
  document.getElementById("book-ticket-btn").style.display = "inline-block";
}

// Close Movie Popup
function closePopup() {
  const popup = document.getElementById("movie-popup");
  popup.style.display = "none";
}

// Book Ticket
function bookTicket() {
  alert("Ticket Booked Successfully!");
  closePopup();
}

// Filter Movies based on Search
function filterMovies() {
  const searchQuery = document.getElementById("search").value.toLowerCase();
  const filteredMovies = movies.filter(movie => movie.title.toLowerCase().includes(searchQuery));
  populateMovies(filteredMovies);
}

// Show Splash Screen for 3 Seconds
function showSplashScreen() {
  setTimeout(() => {
    document.getElementById("splash-screen").style.display = "none";
    document.getElementById("main-content").style.display = "block";
    populateMovies();
  }, 3000); // 3 seconds
}

// Initialize Splash Screen
showSplashScreen();
